import './Country.css';

const Country = ({name, flag, capital, continent, poblation}) => {
    
     return (
         <div className="country-container">
             <h3>{name}</h3>
             <img src={flag} alt="Not found"/>
             <div>
                 <h5>Capita: {capital}</h5>
                 <h5>Continent: {continent}</h5>
                 <h5>Population: {poblation}</h5>
             </div>
         </div>
     );
 };


